window.bookSummaryJSON = "<p>Niko is caught in a powerful spell that was cast from the very book he sought to protect. Trapped between life and death, his chances of returning look grim. </p> <p>Gem is determined to set things right. Armed only with her innate knowledge of language, she begins her daunting quest to break the diabolical spell...no matter the cost. When an irreversible action unleashes a new threat, Keystone scrambles into action. Lives are at stake as the team scours the city in search of an elusive foe. </p> <p>A bond forged in secrets. A courageous sacrifice. Will Gem succeed at her daring attempt, or will she inadvertently destroy them all?</p>"; 
